/**
 * Navbar - Variables
 */
import { COLOUR } from '../../theme/variables/colour'

export const NAVBAR = {
  background: COLOUR.white,
  colourActive: COLOUR.dark,
  colourHover: '#aaa',
  height: '4rem'
}
